import './App.css';
import CarouselControll from "./components/Carousel"
import { NavbarNested } from './components/Navbar';
import { Tab, Tabs, Nav, Container, Navbar } from 'react-bootstrap';



function App() {
  return (
    <div className="App">
      <header className="App-header">
        {/* <NavbarNested></NavbarNested> */}
        <Navbar bg="dark" variant="dark" className='navbar' sticky='top'>
          {/* <Container> */}
            <Navbar.Brand href="/">Welcome to Scrummage</Navbar.Brand>
            <Nav className="me-auto">
              <Nav.Link href="/">Home</Nav.Link>
              <Nav.Link href="/login">Login</Nav.Link>
              <Nav.Link href="/register">Register</Nav.Link>
            </Nav>
          {/* </Container> */}
        </Navbar>
        <CarouselControll></CarouselControll>

      </header>
    </div>
  );
}

export default App;
